import React, {Component} from 'react';
import Modal from './Modal';

export class MainUI extends Component{
  modalProps = {
    triggerText: 'Launch the Modal!'
  };


  render() {

    return (
      <div className='mainUI'>
       <Modal modalProps={this.modalProps}/>
      </div>


      );
  }
}

export default MainUI;
